import { RouterProvider } from 'react-router-dom';
import router from './router';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (
    <div className="app-container">
      {/* 全局导航 - 所有页面都有 */}
      <Header />
      {/* 路由页面内容 */}
      <RouterProvider router={router} />
      {/* 全局底部 - 所有页面都有 */}
      <Footer />
    </div>
  );
}

export default App;
